import React from 'react';
import Nav from './navBar/nav';
import Main from './main/main';
import {
    BrowserRouter as Router,
    Switch,
    Route,
  } from "react-router-dom";

export default function App() {
    return(
    <Router>
        <Nav />
        <Switch>
        <Main className="bg"/>   

        </Switch>
    </Router>
    )
}
